import { Component, OnInit } from "@angular/core";
import { Observable } from "rxjs";
import { OperationsService } from "src/app/services/operations.service";
import OperationModel from "../../models/operation-model";

@Component({
  selector: "app-main-page",
  templateUrl: "./main-page.component.html",
  styleUrls: ["./main-page.component.css"],
})
export class MainPageComponent implements OnInit {
  operations$: Observable<OperationModel[]>;
  constructor(private operationService: OperationsService, private account) {}

  ngOnInit(): void {
    this.operationService.getAll();
    this.operations$ = this.operationService.operations$;

    this.accountsService.getAll();
    this.accounts$ = this.accountsService.accounts$;
  }

  search(account: string) {
    console.log(account);
  }
}
